import React from "react";

import { Navbar, NavLink, NavDropdown } from "react-bootstrap";

import "./NavigationBar.css";

const NavigationBar = () => {
	return (
		<div className="navigation-bar">
			<NavDropdown title = "Mindustry Tool">
				<NavDropdown.Item href="/home">Home</NavDropdown.Item>
				<br/>
				<NavDropdown.Item href="/schematic">Schematic</NavDropdown.Item>
				<br/>
				<NavDropdown.Item href="/map">Map</NavDropdown.Item>
				<br/>
				<NavDropdown.Item href="/logic">Logic</NavDropdown.Item>
			</NavDropdown>
		</div>
	);
};

export default NavigationBar;
